import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first visible "Electronics" category link (category navigation)
    // Try to find a category card with "Electronics"
    let electronicsSelector = null;
    // Try category card first
    const categoryCard = await page.$('.category-card');
    if (categoryCard) {
      // There are multiple, find the one with "Electronics"
      const cards = await page.$$('.category-card');
      for (const card of cards) {
        const text = await card.textContent();
        if (text && text.trim().toLowerCase().includes('electronics')) {
          electronicsSelector = card;
          break;
        }
      }
    }

    // If not found, try an <a> with text "Electronics"
    let clicked = false;
    if (electronicsSelector) {
      await electronicsSelector.scrollIntoViewIfNeeded();
      await electronicsSelector.click();
      clicked = true;
    } else {
      // Try to find an <a> with exact text "Electronics"
      const aHandles = await page.$$('a');
      for (const a of aHandles) {
        const text = await a.textContent();
        if (text && text.trim() === 'Electronics') {
          await a.scrollIntoViewIfNeeded();
          await a.click();
          clicked = true;
          break;
        }
      }
    }

    // Wait for category page to load: look for heading or products grid
    // Wait for a heading with "Electronics" or a grid/list of products
    await page.waitForSelector('h2', { timeout: 5000 });
    // Find the heading for verification
    const headings = await page.$$('h2');
    let foundHeading = '';
    for (const h of headings) {
      const text = await h.textContent();
      if (text && text.toLowerCase().includes('electronics')) {
        foundHeading = text.trim();
        break;
      }
    }

    // Wait for products grid/list to appear
    let productsSelector = '.products-grid';
    let productsGrid = await page.$(productsSelector);
    if (!productsGrid) {
      productsSelector = '.products-list';
      productsGrid = await page.$(productsSelector);
    }
    await page.waitForSelector(productsSelector, { timeout: 5000 });

    // Extract product titles in the Electronics category
    const productTitles = await page.$$eval(
      `${productsSelector} .product-title`,
      nodes => nodes.map(n => n.textContent.trim())
    );

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    return {
      success: true,
      action: "Navigated to Electronics category and extracted product titles",
      extractedData: {
        heading: foundHeading,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
